			<section id="section-pres">
				<img class="obj" src="img/entreprise/shape-pres.svg" alt="">
				<div class="wrapper">
					<div class="container-el">
						<div class="el container__anim">
							<div class="content">
								<div class="illu anim__fade anim__delayMedium_1">
									<img src="img/entreprise/pres-illu-1.png" alt="">
								</div>
								<div class="text">
									<h3 class="anim__slide anim__delayMedium_2">
										Le Skeelz Lab : faites de votre marque employeur une référence
									</h3>
									<p class="anim__slide anim__delayMedium_3">
										Nos designers et nos développeurs vous aident à mettre en place votre propre plateforme, à optimiser votre site carrières mais également à engager vos communautés sur les réseaux sociaux. Le Skeelz Lab c'est surtout la garantie que vos RH/Codir/Comex soient épaulés pour une transformation digitale innovante et efficace toute l'année. Alors let's go, let's Lab !
									</p>
								</div>
							</div>
						</div>
						<div class="el container__anim">
							<div class="content">
								<div class="illu anim__fade anim__delayMedium_1">
									<img src="img/entreprise/pres-illu-2.png" alt="">
								</div>
								<div class="text">
									<h3 class="anim__slide anim__delayMedium_2">
										Skeelz Executive: détectez aujourd'hui vos leaders de demain 
									</h3>
									<p class="anim__slide anim__delayMedium_3">
										Skeelz Executive vous permet de recruter les meilleurs talents du marché - Experts et Managers (CDI-CDD) - mais aussi d'optimiser vos futures organisations (veille, mapping, diversité...). Vous pourrez ainsi soit constituer les COMEX & CODIR adéquates pour diriger au mieux votre entreprise, soit mandater en freelance nos Experts pour assurer vos transitions en toute confiance.
									</p>
								</div>
							</div>
						</div>
						<div class="el container__anim">
							<div class="content">
								<div class="illu anim__fade anim__delayMedium_1">
									<img src="img/entreprise/pres-illu-3.png" alt="">
								</div>
								<div class="text">
									<h3 class="anim__slide anim__delayMedium_2">
										La Skeelz Academy: le numérique décrypté 
									</h3>
									<p class="anim__slide anim__delayMedium_3">
										À l'heure où tout va très vite - trop vite même pour beaucoup - il est capital pour toute entreprise de s'armer face à la numérisation de l'humanité. Mais pas de panique ! Skeelz vous propose un programme de formations, toutes destinées à assimiler et maîtriser la culture numérique. Et peu importe votre âge ou vos acquis techniques, à la Skeelz Academy tout le monde en ressort transformé. C'est une expérience immersive.
									</p>
								</div>
							</div>
						</div>
					</div>
				</div>
			</section>

			<section id="section-ftr" class="container__anim">
				<div class="wrapper">
					<div class="container-text">
						<h2 class="anim__slide anim__delayMedium_1">L’innovation comme ADN</h2>
						<p class="anim__slide anim__delayMedium_2">Devenir le cabinet du futur ? ça se joue dès à présent.</p>
					</div>
					<div class="container-el">
						<div class="el">
							<img class="icn anim__slide anim__delayMedium_3" src="img/entreprise/ftr-icn-1.svg" alt="">
							<h3 class="anim__slide anim__delayMedium_4">Recruitement Thinkers</h3>
							<p class="anim__slide anim__delayMedium_5">
								Chaque semaine, notre équipe se réunit pour challenger le processus de recrutement de chacun de nos clients mais aussi le nôtre. Parce que chez Skeelz on n'aime pas le status quo, et parce que la routine n'est jamais moteur de performance.
							</p>
						</div>
						<div class="el">
							<img class="icn anim__slide anim__delayMedium_4" src="img/entreprise/ftr-icn-2.svg" alt="">
							<h3 class="anim__slide anim__delayMedium_5">Lean Recruiters</h3>
							<p class="anim__slide anim__delayMedium_6">
								Adepte du "Lean Recruitment", Skeelz utilise les méthodes agiles pour attirer et intégrer les meilleurs talents. Cela nous permet de confronter en temps réel nos solutions au marché via une boucle dite " build-measure-learn".
							</p>
						</div>
